import React from "react";

class App extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      title: "Eduardo Mendoza",
      headerLink: {
        title: "Home",
        path: "/",
      },
      headerLink: {
        title: "Home",
        path: "/",
      },
      headerLink: {
        title: "Home",
        path: "/",
      },
    };
  }

  render() {
    return <div>Hello from React!</div>;
  }
}

export default App;
